  expected_count: 5
  input: TEXT,F3A,,"June 21, 2006 The Committee hereby files an amended report to
    correct the date of receipt for a contribution of $5,000 from the Laborers' Political
    League. The previous report reflected a receipt date of 11-19-04 which is the
    date that the check was received by the Committee's treasurer and deposited into
    its account. It has subsequently been determined that the check was actually sent
    to the Committee's campaign office where it was held until forwarded to the treasurer's
    office.                   The amended report reflects a revised receipt date of
    10-12-04.  In so doing, the contribution has been redesignated as for the general
    election held on 11-2-04. The Committee has confirmed with the donor committee
    that the redesignation of the contribution is infact correct.The Committee will
    take appropriate action to remedy those weaknesses in its reporting procedures
    which resulted in the incorrect disclosure of the aforementioned contribution.  It
    has already identified the process which resulted in the erroneous reporting and
    is implementing corrective measures to prevent the mistake from happening in the
    future.  The Committee recognizes the importance of timely and accurate reporting
    and appreciates your assistance in this matter.      "
